import React from 'react';
import { withCookies } from 'react-cookie';
import './EditingPanel.style.scss';
import { CloseCircleFilled } from '@ant-design/icons';
import PageBase from '../../../../../utilities/PageBase/PageBase';

class EditingPanel extends PageBase {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: false
    }
  }

  setVisible(isVisible) {
    this.setState({ isVisible });
  }

  render() {
    return (
      <div className="product-management__supplier-dialog__editing-panel">
        <span onClick={() => this.setVisible(true)}>Chỉnh sửa</span>

      </div>
    )
  }
}
export default withCookies(EditingPanel);
